import React, { Component } from 'react';
import InfoContent from './Info/Content';

export default class TopContentWindows extends Component {
  state = {
    info: false,
    projects: false,
    contact: false
  }

  render() {
    return (
      <div>
        <InfoContent />
      </div>
    )
  }
}
